import React from "react";
import PropTypes from "prop-types";
import { Col, Row } from "antd";

import Skill, { POSITION_SKILL } from "./skill";

const SkillTree = () => {
  return (
    <Row>
      <Col
        style={{
          backgroundColor: "yellow",
          width: "500px",
          height: "500px",
          paddingLeft: "150px",
        }}
      >
        
        <Skill position={POSITION_SKILL.MIDDLE} positionParent={null} />
        <Skill
          position={POSITION_SKILL.RIGHT_BOTTOM}
          positionParent={POSITION_SKILL.MIDDLE}
        />
        <Skill
          position={POSITION_SKILL.MIDDLE}
          positionParent={POSITION_SKILL.RIGHT_BOTTOM}
        />
      </Col>
    </Row>
  );
};

SkillTree.propTypes = {
  character: PropTypes.string,
};

export default SkillTree;
